import{_ as e,o as i,c as t,O as a}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 60.2-110 State Job Service and Unemployment Insurance Services Division.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/60.2-110.md","filePath":"vacode/60.2-110.md"}'),o={name:"vacode/60.2-110.md"},n=a('<h1 id="§-60-2-110-state-job-service-and-unemployment-insurance-services-division" tabindex="-1">§ 60.2-110 State Job Service and Unemployment Insurance Services Division. <a class="header-anchor" href="#§-60-2-110-state-job-service-and-unemployment-insurance-services-division" aria-label="Permalink to &quot;§ 60.2-110 State Job Service and Unemployment Insurance Services Division.&quot;">​</a></h1><p>The Commission may establish two coordinate divisions: the Virginia State Job Service, created pursuant to § <a href="/vacode/60.2-400/">60.2-400</a>, and the Unemployment Insurance Services Division. Each division shall be responsible for the discharge of its distinctive functions. Each division shall be a separate administrative unit, with respect to personnel, budget, and duties, except insofar as the Commission may find that such separation is impracticable. In lieu, however, of establishing the two divisions the Commission may cooperate with and utilize the personnel and services of employment offices or services operated by the United States or any of its authorized agencies but only to the extent necessary for the federal employment offices or services to perform the functions imposed upon employment offices by § <a href="/vacode/60.2-601/">60.2-601</a> and subdivision A 5 of § <a href="/vacode/60.2-612/">60.2-612</a>.</p><p>Code 1950, § 60-28; 1968, c. 738, § 60.1-33; 1986, c. 480; 2022, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0668" target="_blank" rel="noreferrer">668</a>.</p>',3),s=[n];function r(c,d,h,l,m,p){return i(),t("div",null,s)}const u=e(o,[["render",r]]);export{f as __pageData,u as default};
